// src/components/Feedback.js
import React, { useState } from "react";
import axios from "axios";
import "./Feedback.css";

const Feedback = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    rating: 5,
    message: ""
  });
  const [submitted, setSubmitted] = useState(false);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const response = await axios.post("http://localhost:5000/api/feedback", formData);
      
      if (response.data.success) {
        setSubmitted(true);
        setFormData({ name: "", email: "", rating: 5, message: "" });
      }
    } catch (err) {
      console.error("Error submitting feedback:", err);
      alert("Failed to submit feedback. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  if (submitted) {
    return (
      <div className="feedback-container">
        <div className="feedback-success">
          <div className="success-icon">✅</div>
          <h2>Thank You!</h2>
          <p>Your feedback has been submitted successfully.</p>
          <button 
            onClick={() => setSubmitted(false)}
            className="submit-another-btn"
          >
            Submit Another Feedback
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="feedback-container">
      <div className="feedback-header">
        <h1>We Value Your Feedback</h1>
        <p>Help us improve our service by sharing your experience</p>
      </div>

      <form onSubmit={handleSubmit} className="feedback-form">
        <div className="form-group">
          <label htmlFor="name">Your Name</label>
          <input
            type="text"
            id="name"
            name="name"
            value={formData.name}
            onChange={handleChange}
            required
            placeholder="Enter your name"
          />
        </div>

        <div className="form-group">
          <label htmlFor="email">Email Address</label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
            placeholder="Enter your email"
          />
        </div>

        <div className="form-group">
          <label htmlFor="rating">Rating</label>
          <div className="rating-stars">
            {[1, 2, 3, 4, 5].map((star) => (
              <React.Fragment key={star}>
                <input
                  type="radio"
                  id={`star-${star}`}
                  name="rating"
                  value={star}
                  checked={Number(formData.rating) === star}
                  onChange={handleChange}
                />
                <label htmlFor={`star-${star}`} className="star-label">
                  ⭐
                </label>
              </React.Fragment>
            ))}
          </div>
          <div className="rating-text">
            {formData.rating === 5 && "Excellent"}
            {formData.rating === 4 && "Very Good"}
            {formData.rating === 3 && "Good"}
            {formData.rating === 2 && "Fair"}
            {formData.rating === 1 && "Poor"}
          </div>
        </div>

        <div className="form-group">
          <label htmlFor="message">Your Feedback</label>
          <textarea
            id="message"
            name="message"
            value={formData.message}
            onChange={handleChange}
            required
            rows="5"
            placeholder="Tell us about your experience..."
          />
        </div>

        <button type="submit" className="submit-btn" disabled={loading}>
          {loading ? "Submitting..." : "Submit Feedback"}
        </button>
      </form>
    </div>
  );
};

export default Feedback;
